import react from 'react'
import ListGroup from 'react-bootstrap/ListGroup';
const Menus=()=>{
    return(
<ListGroup style={{border:'5px'}}>
      
      <ListGroup.Item tag="a" href="/" action>Home</ListGroup.Item>
      <ListGroup.Item tag="a" href="/add-course" action>Add  Course</ListGroup.Item>
      <ListGroup.Item  tag="a" href="view-course" action>View Courses</ListGroup.Item>
      <ListGroup.Item tag="a" href="about" action>About</ListGroup.Item>
      <ListGroup.Item  tag="a" href="contact" action> Contact</ListGroup.Item>
    </ListGroup>
    );
};
export default Menus;
